import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  root: {
    margin: '5%',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'auto',
    fontFamily: 'sans-serif',
    fontWeight : '600',
    textAlign : 'center'
  },
  table: {
    minWidth: 700,
  },
});

let id = 0;
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}
function Example(props) {
  const { classes } = props;
  
  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell style={{fontWeight : '600', fontSize : '1.2em', color :'black'}} align="center">Company</TableCell>
            <TableCell style={{fontWeight : '600', fontSize : '1.2em', color :'black'}} align="center">Open</TableCell>
            <TableCell style={{fontWeight : '600', fontSize : '1.2em', color :'black'}} align="center">High</TableCell>
            <TableCell style={{fontWeight : '600', fontSize : '1.2em', color :'black'}} align="center">Low</TableCell>
            <TableCell style={{fontWeight : '600', fontSize : '1.2em', color :'black'}} align="center">Change</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.list.map(row => (
            <TableRow>
              <TableCell component="th" scope="row" align="center">
                {row['01. symbol']}
              </TableCell>
              <TableCell align="center">{row['02. open']}</TableCell>
              <TableCell align="center">{row['03. high']}</TableCell>
              <TableCell align="center">{row['04. low']}</TableCell>
              <TableCell align="center">{row['09. change']}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

Example.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Example);
